# https://leetcode.com/problems/find-all-anagrams-in-a-string/

from collections import defaultdict
from typing import List


class Solution:

    def findAnagrams(self, s: str, p: str) -> List[int]:
        hashmap = defaultdict(int)
        ans = []
        len_p, len_s = len(p), len(s)
        if  len_p > len_s:
            return []

        # build hashmap
        for ch in p: hashmap[ch] += 1

        # initial full pass over the window
        for i in range( len_p-1):
            if s[i] in hashmap: hashmap[s[i]] -= 1

        # slide the window with stride 1
        for i in range(-1, len_s - len_p + 1):
            if i > -1 and s[i] in hashmap:
                hashmap[s[i]] += 1
            if i+ len_p < len_s and s[i + len_p] in hashmap:
                hashmap[s[i+len_p]] -= 1

            # check whether we encountered an anagram
            if all(v == 0 for v in hashmap.values()):
                ans.append(i+1)
        return ans

    # TLE
    def findAnagrams2(self, s: str, p: str) -> List[int]:
        l = len(p)
        ans = []
        start = 0
        end = l-1

        def isAnagram(a, b):
            if a == b:
                return True
            for i in range(l):
                if a[i] in b:
                    idx = b.index(a[i])
                    b = b[:idx] + b[idx+1:]
                else:
                    return False
            return True

        matched = False
        while end < len(s):
            if matched:
                if s[start] == s[end]:
                    ans.append(start)
            else:
                if isAnagram(s[start:end+1], p):
                    ans.append(start)
                    flag = True
                else:
                    flag = False
            start += 1
            end += 1
        return ans

